			return null;
		} catch (SignatureException e) {
			System.err.println("Cannot generate signature for timed key, exiting");
			e.printStackTrace();
			return null;
		}		
		List<Object> keyList = new ArrayList<Object>();		
		keyList.add(prodSig);
		keyList.add(timedKey);
		keyList.add(prodPriv);	
		return keyList;
